import { useState } from "react";
import PageHeader from "./common/pageHeader";

const FavCards = ({ allCards }) => {
   const [favCards, setFavCards] = useState([]);
   return (
      <>
         <PageHeader title={"Favorite cards"} />
         <div className="row"></div>
      </>
   );
};

export default FavCards;
